/**
 * This class holds the logical action of the execution, i.e:
 * the action name and an array of the values
 */
export default class ExecutionLogicalAction {
    actionName: string;
    values: string;
    constructor(actionName: string, values: string);
    static fromJSON(lAction: any): ExecutionLogicalAction;
    toJSON(): {
        actionName: string;
        values: string;
    };
}
